
apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: CLUSTER_ADDR
  name: CLUSTER_NAME
contexts:
- context:
    cluster: CLUSTER_NAME
    namespace: default
    user: cluster-user
  name: CLUSTER_NAME
current-context: CLUSTER_NAME
kind: Config
preferences: {}
users:
- name: cluster-user
  user:
    exec:
      apiVersion: client.authentication.k8s.io/v1beta1
      args:
      - ce
      - cluster
      - generate-token
      - --cluster-id
      - CLUSTER_OCID
      - --region
      - ca-toronto-1
      command: oci
      env: []
      interactiveMode: IfAvailable
      provideClusterInfo: false